import React, { Component } from 'react'
import Header from './Header'

class Todo extends Component {
    constructor(){
        super()
        this.state = {
            tasks : ['school', 'home', 'work']
        }
    }
    render() {
        this.state.tasks.map((task)=>{
            console.log(task)
            return (
                <div>
                    <Header debug = {this.state.debug} />
                </div>
            )
        })

    }
}

export default Todo;
